import React from 'react';
import { Nav } from 'react-bootstrap';
import './GeneralInfoSidebar.css';

const GeneralInfoSidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar-section">
        <h5>Información general</h5>
        <Nav className="flex-column">
          <Nav.Link href="#">Inicio</Nav.Link>
          <Nav.Link href="#">La Asociación</Nav.Link>
          <Nav.Link href="#">Redes Sociales</Nav.Link>
          <Nav.Link href="#">Nuestro albergue</Nav.Link>
          <Nav.Link href="#">Profesionales colaboradores</Nav.Link>
          <Nav.Link href="#">Contacto</Nav.Link>
          <Nav.Link href="#">Calendario de google</Nav.Link>
        </Nav>
      </div>
    </div>
  );
};

export default GeneralInfoSidebar;
